insert  into `t_expertise`(`id`,`userCode`,`specialize`) values (1,'Admin','<p><strong>การพัฒนาปัญญาประดิษฐ์สำหรับแยกแยะความหมายของโบราณวัตถุของพิพิธภัณฑ์พิมาย</strong></p><p>งานวิจัยนี้ผู้วิจัยได้รับแรงบันดาลใจจากการศึกษาโบราณวัตถุที่มีคุณค่าทางศิลปะของพิพิธภัณฑ์สถานของอำเภอพิมายเนื่องจากในปัจจุบันขาดแคลนผู้เชี่ยวชาญในการบรรยายความหมายของโบราณวัตถุและการเชื่อมโยงของประวิติศาสตร์ดังนั้นผู้วิจัยจึงได้ทำการสร้างระบบปัญญาประดิษฐ์ที่ช่วยในการแยกแยะและให้ความหมายของภาพโดยการบวนการสร้างแบบจำลองที่ทำการประมวลผลด้วยภาพและจดจำในรูปของแบบจำลองที่คล้ายโครงข่ายประสาทของมันสมองมนุษย์หรือ ระบบโครงข่ายประสาทเทียมเพื่อให้คอมพิวเตอร์ทำการจดจำและเรียนรู้เพื่อสร้างพิพิธภัณเสมือนจริงด้วยระบบความจริงเสมือนเสริม (Augmented Reality) เพื่อแสดงเรื่องราวทางประวัติศาสตร์ให้ผู้เข้าชมผ่านระบบสื่อประสม (Multimedia) และนอกจากนั้นผู้วิจัยได้ทำกระบวนการสร้างออนโทโลยีเพื่อช่วยในการหาความเชื่อมโยงทางศิลปะเพื่อมุ่งเน้นให้ผู้ชมได้รับความรู้และความเชื่อมโยงทางประวัติศาสตร์ของโบราณวัตถุนั้นๆ</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; กระบวนการสร้างงานวิจัย</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; งานวิจัยนี้เป็นงานวิจัยที่สร้างปัญญาประดิษฐ์ในการทำนายภาพวัตถุโบราณและหาความสัมพันธ์ทางประวัติศาสตร์ดังนั้นสิ่งสำคัญในการสร้างแบบจำลองนี้คือภาพและเนื้อหาของภาพในการสร้างปัญญาประดิษฐ์ที่สามารถมองเห็นได้โดยกระบวนทาง (Image Processing) และโครงข่ายประสาทเทียมเพื่อทำการบอกว่าวัตถุนั้นเป็นวัตถุโบราณชนิดได แล้วหลังจากนั้นจึงทำการค้นหาความสัมพันธ์โดยเนื้อหาของของภาพที่ถูกอ่านได้ ดังนั้นจึงได้ทำการสร้างออนโทโลยีสำหรับระบบปัญญาประดิษฐ์ซึ่งใช้กระบวนการตัดคำอัตโนมัติ (Word Segmentation) ซึ่งทั้งหมดนี้ได้อธิบายดังภาพที่ 1</p><p>&nbsp;</p><p>ภาพที่ 1 กรอบแนวคิดในการสร้างปัญญาประดิษฐ์ในการบอกความสำคัญของวัตถุโบราณ</p>'),(2,'chatchai.j','<p><img src=\"uploads/2022/mod_freedom_froala/53ddd80a605e8ac83dc01f224564d55216562873.jpg\" style=\"width: 135px;\" class=\"fr-fic fr-dii\"></p><p><strong><span style=\"font-family: Impact, Charcoal, sans-serif; color: rgb(41, 105, 176);\">Mr Chatchai Jiamram</span></strong></p><p>Expertise in d