/*Table structure for table `t_headeraproval` */

DROP TABLE IF EXISTS `t_headeraproval`;

CREATE TABLE `t_headeraproval` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `evaluateLevel` int(11) DEFAULT NULL,
  `departmentCode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `evaluateHeader` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `isActive` tinyint(4) DEFAULT 1,
  `userCode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

