/*Table structure for table `t_improveplan` */

DROP TABLE IF EXISTS `t_improveplan`;

CREATE TABLE `t_improveplan` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `staffCode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `topic` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `improvementType` int(11) DEFAULT NULL,
  `yearPlan` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `academicYear` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL,
  `budget` decimal(10,0) DEFAULT NULL,
  `sourceDepartment` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sourceType` int(11) DEFAULT NULL,
  `duration` int(11) DEFAULT NULL,
  `monthPlan` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `t_improveplan` */

LOCK TABLES `t_improveplan` WRITE;

UNLOCK TABLES;

/*Table structure for table `t_label` */

DROP TABLE IF EXISTS `t_label`;

